import React, { useEffect, useState } from "react";
import { useRouter } from "next/router";
import { base } from "../../utils/airtableUtils";

export default function UserTeam() {
  //   const [team, setTeam] = useState([]);
  const [records, setRecords] = useState([]);
  const {
    query: { userId },
  } = useRouter();

  useEffect(() => {
    if (userId) {
      base("Draft Selections")
        .select({
          view: "Grid view",
        })
        .eachPage(
          function page(records) {
            records.forEach(function ({ fields }) {
              if (fields.userId === userId) {
                setRecords(fields.players);
              }
            });
          },
          function done(err) {
            if (err) {
              console.error(err);
              return;
            }
          }
        );
      //     0: "rec2FXdmPdB7bZVxb"
      // 1: "recfE29jg0S5yiRmJ"
      base("Draft Selections").find(
        ["rec2FXdmPdB7bZVxb", "recfE29jg0S5yiRmJ"],
        function (err, record) {
          if (err) {
            console.error(err);
            return;
          }
          console.log("Retrieved", record.fields);
        }
      );
    }
  }, [userId]);
  return (
    <div>
      <h1>User Team</h1>
      {team && <div></div>}
    </div>
  );
}
